    `,show:!0},{id:"2024-04-09_HyperbolicConnections",title:"Hyperbolic Connections",date:"2024-04-09",sort_key:"2024-04-09:02",project_id:"p5-sketchbook",img_format:"png",alt_text:"A circle decorated with arcs in light blue and purple",tagline:"A swirly pattern made in the hyperbolic plane. This was originally made in 2021, but I tweaked it a bit when cleaning up p5-sketchbook.",description:`
