    `,show:!0},{id:"2024-04-09_Refill",title:"Refill",date:"2024-04-09",sort_key:"2024-04-09:03",project_id:"p5-sketchbook",img_format:"png",alt_text:"A grid of meters from the Refill game. Some are filled with blue liquid, others with red, others empty",tagline:"An impossible game about trying to keep a bunch of meters full.",description:`
