    `,show:!0}],Bc=[...Mc,{id:"2024-02-04_BlueVelvetScarf",title:"Blue Velvet Scarf",date:"2024-02-04",sort_key:"2024-02-04:01",project_id:"blue-velvet-scarf",tagline:"The finished scarf. In total, it took about a month and a half and 25 pattern repeats",img_format:"jpg",alt_text:"The finished scarf resting on a table",description:`
